const routes: Routes = [
  {
    path: 'login',
    component: LoginComponent,
  },

  { path: '', redirectTo: 'login', pathMatch: 'full' },
];

@NgModule({
  declarations: [LoginComponent],
  imports: [RouterModule.forChild(routes)],
  exports: [LoginComponent],
})
export class Module {}
